import Link from 'next/link'

const Navbar = () => {
    return <div>
        <ul>
            <li><Link href="/"><a>index</a></Link></li>
            <li><Link href="/about"><a>about</a></Link></li>
        </ul>
        <style jsx>{`
        li{
            list-style-type: none;
        }
        `}</style>
    </div>
}

export default Navbar
